The A-Team (XXX A Parody / DvdRip / 2010) 

This all-anal comedy is a triple-X take on the 80's action TV show, The A-Team. When Bree's husband goes missing, she calls on a rogue military team of fugitives, The A-Team! They break the rules, bring the bad guys to justice and still have time for loads of non-stop sex! The ladies love them, the men want to be them! From tattooed bikers to Mexican drug lords to corrupt cops, this hilarious spoof has it all! You'll love it when a plan cums together!

